        var treeList = [];
        //
        var fa = function(upId) {
            var _array = [];
            for (var i = 0; i < list.length; i++) {
                var n = list[i];
                if (n[field_upId] === upId) {
                    n.children = fa(n[field_Id]);
                    _array.push(n);
                }
            }
            return _array;
        }
        rootList.forEach(function(temo) {
            var temTreeObj = fa(temo); //
            if (temTreeObj) {
                temTreeObj.forEach(function(o) {
                    treeList.push(o);
                });
            }
        });
        return treeList;
