			for(var i=0; i<options.value.length; i++){
				var value = options.value[i]
					,$elem = options.elem.find(':checkbox[value="'+value+'"]');

				$elem.prop('checked', true);

				if(value.indexOf('-') < 0){ //
					$elem.parent().find('.city :checkbox').prop('checked', true);
				}
			}
