layui.define(['laydate','jquery'],function (exports) {


var MOD_NAME = 'timePicker',
    $ = layui.jquery,
    laydate = layui.laydate;
var timePicker = function () {
    this.v = '0.0.3';
};

/**
 * 
 */
timePicker.prototype.render = function (opt) {

    var elem = $(opt.elem);

    //
    var timeStamp = opt.options.timeStamp || false;
    var format = opt.options.format || 'YYYY-MM-DD HH:mm:ss';

    elem.on('click',function (e) {
        e.stopPropagation();

        if($('.timePicker').length >= 1){
            $('.timePicker').remove();
            return false;
        }
        var t = elem.offset().top + elem.outerHeight()+"px";
        var l = elem.offset().left +"px";

        var timeDiv = '<div class="timePicker layui-anim layui-anim-upbit" style="left:'+l+';top:'+t+';">';
        timeDiv +='<div class="time-div">' +
            '<div class="time-info">' +
            '<ul class="time-day"><span></span><li><input type="radio" name="day" value="1"></li><li><input type="radio" name="day" value="2"></li><li><input type="radio" name="day" value="3"></li></ul> ' +
            '<ul class="time-week"><span></span><li><input type="radio" name="day" value="4"></li><li><input type="radio" name="day" value="5"></li><li><input type="radio" name="day" value="6"></li></ul> ' +
            '<ul class="time-month"><span></span><li><input type="radio" name="day" value="7"></li><li><input type="radio" name="day" value="8"></li><li><input type="radio" name="day" value="9"></li></ul> ' +
            '<ul class="time-quarter"><span></span><li><input type="radio" name="day" value="10"></li><li><input type="radio" name="day" value="11"></li><li><input type="radio" name="day" value="12"></li></ul> ' +
            '<ul class="time-year"><span></span><li><input type="radio" name="day"  value="13"></li><li><input type="radio" name="day"  value="14"></li><li><input type="radio" name="day"  value="15"></li></ul>' +
            '</div>' +
            '<div class="time-custom">' +
            '<div class="layui-timepicker-custom"  data-role="display">' +
            '<span></span>' +
            '<i class="layui-icon layui-icon-down" ></i>' +
            '</div> ' +
            '<div class="time-select">' +
            '<input type="text" class="layui-input" id="sTime">' +
            '<input type="text" class="layui-input" id="eTime">' +
            '</div></div>' +
            '<div class="time-down">' +
            '<div class="layui-btn layui-btn-sm layui-btn-normal"   data-role="clear"></div>' +
            '<div class="layui-btn layui-btn-sm" data-role="sure"></div>' +
            '</div>' +
            '</div>';
        timeDiv = $(timeDiv);
        //
        $('body').append(timeDiv);
        //
        $('[data-role="display"]').on('click',function () {
            $('.time-select').css('display','flex');
            $(this).find('i').remove();
        });
        //
        laydate.render({elem: '#sTime',theme: '#393D49'});
        laydate.render({elem: '#eTime',theme: '#393D49'});
        //
        var $li=$('.time-info').children().find('li');
        $li.on('click',function () {
            $('.time-info').children().find('li').removeClass('active');
            if($(this).children('input').is(':checked')){
                $(this).children('input').prop('checked',false);
            }else{
                $(this).addClass('active');
                $(this).children('input').prop('checked',true);
            }
        });
        $('[data-role="clear"]').on('click',function () {
            elem.val('');
            $('.timePicker').remove();
        })
        // 2018-9-14 - 2018-9-15
        $('[data-role="sure"]').on('click',function () {
            var inputVal=$('.time-info').children().find('input:checked').val();
            var sTime='';
            var eTime='';
            switch (inputVal){
                case '1'://
                    sTime=Moment().startOf('day');
                    eTime=Moment().endOf('day');
                    break;
                case '2'://
                    sTime=Moment().subtract(1, 'days').startOf('day');
                    eTime=Moment().subtract(1, 'days').endOf('day');
                    break;
                case '3'://
                    sTime=Moment().subtract(-1, 'days').startOf('day');
                    eTime=Moment().subtract(-1, 'days').endOf('day');
                    break;
                case '4'://
                    sTime=Moment().startOf('week');
                    eTime=Moment().endOf('week');
                    break;
                case '5'://
                    sTime=Moment().subtract(1,'week').startOf('week');
                    eTime=Moment().subtract(1,'week').endOf('week');
                    break;
                case '6'://
                    sTime=Moment().subtract(-1,'week').startOf('week');
                    eTime=Moment().subtract(-1,'week').endOf('week');
                    break;
                case '7'://
                    sTime=Moment().startOf('month');
                    eTime=Moment().endOf('month');
                    break;
                case '8'://
                    sTime=Moment().subtract(1,'month').startOf('month');
                    eTime=Moment().subtract(1,'month').endOf('month');
                    break;
                case '9'://
                    sTime=Moment().subtract(-1,'month').startOf('month');
                    eTime=Moment().subtract(-1,'month').endOf('month');
                    break;
                case '10'://
                    sTime=Moment().startOf('quarter');
                    eTime=Moment().endOf('quarter');
                    break;
                case '11'://
                    sTime=Moment().subtract(1,'quarter').startOf('quarter');
                    eTime=Moment().subtract(1,'quarter').endOf('quarter');
                    break;
                case '12'://
                    sTime=Moment().subtract(-1,'quarter').startOf('quarter');
                    eTime=Moment().subtract(-1,'quarter').endOf('quarter');
                    break;
                case '13'://
                    sTime=Moment().startOf('year');
                    eTime=Moment().endOf('year');
                    break;
                case '14'://
                    sTime=Moment().subtract(1,'year').startOf('year');
                    eTime=Moment().subtract(1,'year').endOf('year');
                    break;
                case '15'://
                    sTime=Moment().subtract(-1,'year').startOf('year');
                    eTime=Moment().subtract(-1,'year').endOf('year');
                    break;
                default:
                    sTime=$('#sTime').val();
                    eTime=$('#eTime').val();
                    break;
            }
            var timeDate='';
            if(inputVal){
                if(timeStamp){
                    timeDate =parseInt(sTime/1000) + ' - ' + parseInt(eTime/1000);
                }else{
                    timeDate = sTime.format(format) + ' - ' + eTime.format(format);
                }
            }else{
                timeDate=sTime + ' - ' + eTime;
            }
            elem.val(timeDate);
            $('.timePicker').remove();
        });
    })
};

/**
 * 
 */
timePicker.prototype.hide = function (opt) {
    $('.timePicker').remove();
};

//
var timePicker = new timePicker();

//FIX 
$(window).scroll(function () {
    timePicker.hide();
});

exports(MOD_NAME, timePicker);

    exports(MOD_NAME, timePicker);
})
;
define("timePicker", ["css!plugins/lay-module/timePicker/timePicker.css"], function(){});

